import React from 'react'

function LandingPage() {
  return (
    <div>
      <button>Export to pdf</button>
      <button>Export to excel</button>
      <button>View Userss</button>
      <button>Add User</button>
      <button>View Profile</button>
    </div>
  )
}

export default LandingPage
